(27, 1, '2020-10-09 00:53:45', '2020-10-09 00:53:45', '<p><!-- wp:cover {\"url\":\"http://localhost/The_Kukus/wp-content/uploads/2020/10/hero-scaled.jpg\",\"id\":22,\"dimRatio\":0,\"customOverlayColor\":\"#ffffff\",\"align\":\"full\"} --></p>\n<p><!-- wp:heading {\"align\":\"center\",\"level\":1} --></p>\n<h1>SELAMAT DATANG</h1>\n<p><!-- /wp:heading --></p>\n<p><!-- wp:paragraph {\"align\":\"center\",\"customTextColor\":\"#000000\"} --></p>\n<p style=\"color: #000000;\">The kukus pusatnya roti kukus dengan berbagai macam varian dan&nbsp;<br>kualitas rasa terbaik</p>\n<p><!-- /wp:paragraph --></p>\n<p><!-- /wp:cover --></p>\n<p><!-- wp:heading {\"align\":\"center\"} --></p>\n<h2>Shop by Category</h2>\n<p><!-- /wp:heading --></p>\n<p><!-- wp:shortcode --><br>[product_categories limit=\"3\" columns=\"3\" orderby=\"menu_order\"]</p>\n<p><!-- /wp:heading --></p>\n<p><!-- wp:woocommerce/product-best-sellers {\"columns\":4} /--></p>', 'Homepage', '', 'trash', 'closed', 'closed', '', 'homepage__trashed', '', '', '2020-10-09 03:53:51', '2020-10-09 03:53:51', '', 0, 'http://localhost/The_Kukus/?page_id=27', 0, 'page', '', 0),
